#!/usr/bin/env node
/**
 * Import classic Sudoku puzzles from Cracking the Cryptic.
 *
 * For each puzzle:
 *   1. Fetch crackingthecryptic.com/sudoku?id=N to find the embedded
 *      SudokuPad token or tinyurl redirect.
 *   2. Follow redirects to resolve the final SudokuPad URL/token.
 *   3. Fetch sudokupad.app/api/puzzle/{token} — response may be either
 *      the old JS-object format (ce:[[...]]) or the newer SCL compressed
 *      format (lz-string base64).
 *   4. Decode the grid and build an 81-char givens string.
 *   5. Skip non-standard puzzles (non-9x9, diagonal extras, etc.).
 *   6. Emit JSON entries compatible with internal/curated/curated.json.
 */

const https = require('https');
const http = require('http');

// ── lz-string decompressFromBase64 ──────────────────────────────────────────
const keyStrBase64 = 'REDACTED/=';

function decompressFromBase64(input) {
  if (!input) return '';
  return _lzDecompress(input.length, 32, idx => keyStrBase64.indexOf(input[idx]));
}

function _lzDecompress(length, resetValue, getNextValue) {
  const dictionary = [];
  let enlargeIn = 4, dictSize = 4, numBits = 3, entry = '', result = [];
  let bits, resb, maxpower, power, c;
  const data = { val: getNextValue(0), position: resetValue, index: 1 };

  for (let i = 0; i < 3; i++) dictionary[i] = i;

  bits = 0; maxpower = 4; power = 1;
  while (power !== maxpower) {
    resb = data.val & data.position;
    data.position >>= 1;
    if (data.position === 0) { data.position = resetValue; data.val = getNextValue(data.index++); }
    bits |= (resb > 0 ? 1 : 0) * power;
    power <<= 1;
  }

  let next = bits;
  switch (next) {
    case 0:
      bits = 0; maxpower = 256; power = 1;
      while (power !== maxpower) {
        resb = data.val & data.position;
        data.position >>= 1;
        if (data.position === 0) { data.position = resetValue; data.val = getNextValue(data.index++); }
        bits |= (resb > 0 ? 1 : 0) * power;
        power <<= 1;
      }
      c = String.fromCharCode(bits);
      break;
    case 1:
      bits = 0; maxpower = 65536; power = 1;
      while (power !== maxpower) {
        resb = data.val & data.position;
        data.position >>= 1;
        if (data.position === 0) { data.position = resetValue; data.val = getNextValue(data.index++); }
        bits |= (resb > 0 ? 1 : 0) * power;
        power <<= 1;
      }
      c = String.fromCharCode(bits);
      break;
    case 2:
      return '';
  }

  dictionary[3] = c;
  let w = c;
  result.push(c);

  while (true) {
    if (data.index > length) return '';

    bits = 0; maxpower = 1 << numBits; power = 1;
    while (power !== maxpower) {
      resb = data.val & data.position;
      data.position >>= 1;
      if (data.position === 0) { data.position = resetValue; data.val = getNextValue(data.index++); }
      bits |= (resb > 0 ? 1 : 0) * power;
      power <<= 1;
    }

    switch (c = bits) {
      case 0:
        bits = 0; maxpower = 256; power = 1;
        while (power !== maxpower) {
          resb = data.val & data.position;
          data.position >>= 1;
          if (data.position === 0) { data.position = resetValue; data.val = getNextValue(data.index++); }
          bits |= (resb > 0 ? 1 : 0) * power;
          power <<= 1;
        }
        dictionary[dictSize++] = String.fromCharCode(bits);
        c = dictSize - 1;
        enlargeIn--;
        break;
      case 1:
        bits = 0; maxpower = 65536; power = 1;
        while (power !== maxpower) {
          resb = data.val & data.position;
          data.position >>= 1;
          if (data.position === 0) { data.position = resetValue; data.val = getNextValue(data.index++); }
          bits |= (resb > 0 ? 1 : 0) * power;
          power <<= 1;
        }
        dictionary[dictSize++] = String.fromCharCode(bits);
        c = dictSize - 1;
        enlargeIn--;
        break;
      case 2:
        return result.join('');
    }

    if (enlargeIn === 0) { enlargeIn = 1 << numBits; numBits++; }

    if (dictionary[c] !== undefined) { entry = dictionary[c]; }
    else if (c === dictSize) { entry = w + w[0]; }
    else return null;

    result.push(entry);
    dictionary[dictSize++] = w + entry[0];
    enlargeIn--;
    if (enlargeIn === 0) { enlargeIn = 1 << numBits; numBits++; }
    w = entry;
  }
}

// ── HTTP helpers ─────────────────────────────────────────────────────────────
function fetchUrl(url, maxRedirects = 6) {
  return new Promise((resolve, reject) => {
    const attempt = (url, redirectsLeft) => {
      const mod = url.startsWith('https') ? https : http;
      const req = mod.get(url, { headers: { 'User-Agent': 'Mozilla/5.0 (compatible; sudoku-tui/1.0)' } }, res => {
        if (res.statusCode >= 300 && res.statusCode < 400 && res.headers.location) {
          res.resume();
          if (redirectsLeft <= 0) return reject(new Error('Too many redirects'));
          const next = new URL(res.headers.location, url).href;
          setTimeout(() => attempt(next, redirectsLeft - 1), 200);
          return;
        }
        if (res.statusCode !== 200) {
          res.resume();
          return reject(new Error(`HTTP ${res.statusCode} for ${url}`));
        }
        let body = '';
        res.on('data', d => body += d);
        res.on('end', () => resolve({ url, body }));
      });
      req.on('error', reject);
      req.setTimeout(15000, () => { req.destroy(); reject(new Error('Timeout')); });
    };
    attempt(url, maxRedirects);
  });
}

function sleep(ms) { return new Promise(r => setTimeout(r, ms)); }

// ── Puzzle data parsing ──────────────────────────────────────────────────────

/**
 * Decode a SudokuPad API response which may be:
 *   - Old format: JS object literal  {id:..., ce:[[...]], re:[...], ...}
 *   - New SCL format: "scl" + lzstring.compressToBase64(JS-object-literal)
 *
 * Returns the raw JS-object-literal string (or null on failure).
 */
function decodeApiResponse(raw) {
  raw = raw.trim();
  if (raw.startsWith('scl')) {
    const decompressed = decompressFromBase64(raw.slice(3));
    return decompressed || null;
  }
  // Already the JS object literal
  if (raw.startsWith('{')) return raw;
  return null;
}

/**
 * Parse the 'ce' array from a SudokuPad JS object literal.
 * Returns a 9x9 array of numbers (0 = empty) or null.
 */
function parseCE(jsObj) {
  // Find the ce:[ ... ] section
  const ceStart = jsObj.search(/\bce\s*:/);
  if (ceStart === -1) return null;

  // Walk brackets to extract the ce value
  const bracketStart = jsObj.indexOf('[', ceStart);
  if (bracketStart === -1) return null;

  let depth = 0, end = -1;
  for (let i = bracketStart; i < jsObj.length; i++) {
    if (jsObj[i] === '[') depth++;
    else if (jsObj[i] === ']') { depth--; if (depth === 0) { end = i + 1; break; } }
  }
  if (end === -1) return null;

  const ceStr = jsObj.slice(bracketStart, end);

  // Extract each row from the outer array
  const rows = [];
  let rowDepth = 0, rowStart = -1;
  for (let i = 1; i < ceStr.length - 1; i++) {
    if (ceStr[i] === '[' && rowDepth === 0) { rowDepth = 1; rowStart = i + 1; }
    else if (ceStr[i] === '[') rowDepth++;
    else if (ceStr[i] === ']' && rowDepth === 1) { rowDepth = 0; rows.push(ceStr.slice(rowStart, i)); }
    else if (ceStr[i] === ']') rowDepth--;
  }

  if (rows.length !== 9) return null;

  return rows.map(rowStr => {
    // Split by comma respecting nested braces
    const elements = [];
    let cur = '', bd = 0;
    for (const ch of rowStr) {
      if (ch === '{') { bd++; cur += ch; }
      else if (ch === '}') { bd--; cur += ch; }
      else if (ch === ',' && bd === 0) { elements.push(cur.trim()); cur = ''; }
      else cur += ch;
    }
    elements.push(cur.trim());

    const row = elements.map(e => {
      const m = e.match(/\{v\s*:\s*(\d+)\}/);
      return m ? parseInt(m[1]) : 0;
    });

    if (row.length !== 9) return null;
    return row;
  });
}

/**
 * Parse the 're' (regions) field and return true iff they match standard 9 boxes.
 */
const STANDARD_REGIONS = (() => {
  const regs = [];
  for (let br = 0; br < 3; br++)
    for (let bc = 0; bc < 3; bc++) {
      const cells = [];
      for (let r = 0; r < 3; r++)
        for (let c = 0; c < 3; c++)
          cells.push([br * 3 + r, bc * 3 + c]);
      regs.push(cells);
    }
  return regs;
})();

function isStandardRegions(jsObj) {
  const reStart = jsObj.search(/\bre\s*:/);
  if (reStart === -1) return true; // No regions → assume standard

  const bracketStart = jsObj.indexOf('[', reStart);
  if (bracketStart === -1) return true;

  let depth = 0, end = -1;
  for (let i = bracketStart; i < jsObj.length; i++) {
    if (jsObj[i] === '[') depth++;
    else if (jsObj[i] === ']') { depth--; if (depth === 0) { end = i + 1; break; } }
  }
  if (end === -1) return true;

  const reStr = jsObj.slice(bracketStart, end);
  const allCells = [...reStr.matchAll(/\[(\d+),(\d+)\]/g)].map(m => [parseInt(m[1]), parseInt(m[2])]);

  if (allCells.length !== 81) return false;

  // Group by region (outer brackets)
  const regions = [];
  let rd = 0, rs = -1;
  for (let i = 1; i < reStr.length - 1; i++) {
    if (reStr[i] === '[' && rd === 0) { rd = 1; rs = i; }
    else if (reStr[i] === '[') rd++;
    else if (reStr[i] === ']' && rd === 1) {
      rd = 0;
      const cells = [...reStr.slice(rs, i + 1).matchAll(/\[(\d+),(\d+)\]/g)]
        .map(m => [parseInt(m[1]), parseInt(m[2])]);
      if (cells.length === 9) regions.push(cells.map(([r, c]) => r * 9 + c).sort((a, b) => a - b));
    }
    else if (reStr[i] === ']') rd--;
  }

  if (regions.length !== 9) return false;

  const expected = STANDARD_REGIONS.map(reg => reg.map(([r, c]) => r * 9 + c).sort((a, b) => a - b));
  const sortedRegions = [...regions].sort((a, b) => a[0] - b[0]);
  const sortedExpected = [...expected].sort((a, b) => a[0] - b[0]);

  return JSON.stringify(sortedRegions) === JSON.stringify(sortedExpected);
}

/**
 * Check whether the puzzle has extra constraints (diagonal, etc.).
 * We look for 'di' (diagonals), 'tc' (thermo), 'kc' (killer), 'ac' (arrows)
 * fields that would indicate it's not a pure classic sudoku.
 */
function hasExtraConstraints(jsObj) {
  // Pure classic should have only: id, cs, ce, re, vd (video data)
  // Non-classic indicators:
  const nonClassicFields = /\b(diagonal|diag|di:|dg:|tc:|kc:|ac:|sc:|arrow|thermo|killer|sandwich)\s*:/i;
  return nonClassicFields.test(jsObj);
}

// ── Token extraction ─────────────────────────────────────────────────────────

/**
 * Get the SudokuPad URL from a CTC puzzle page.
 * Returns { type: 'token'|'scl', value: string } or null.
 */
async function getSudokuPadInfo(ctcId) {
  let html;
  try {
    const r = await fetchUrl(`https://crackingthecryptic.com/sudoku?id=${ctcId}`);
    html = r.body;
  } catch (e) {
    process.stderr.write(`  Fetch error for CTC page: ${e.message}\n`);
    return null;
  }

  // Direct SudokuPad embed: <iframe src="https://sudokupad.app/TOKEN">
  // or <a href="https://sudokupad.app/TOKEN">
  const directMatch = html.match(/sudokupad\.app\/([A-Za-z0-9_-]{5,})/);
  if (directMatch) {
    const val = directMatch[1];
    if (val.startsWith('scl')) return { type: 'scl', value: val };
    return { type: 'token', value: val };
  }

  // tinyurl redirect: <iframe src="https://tinyurl.com/...">
  const tinyMatch = html.match(/https?:\/\/tinyurl\.com\/([A-Za-z0-9_-]+)/);
  if (tinyMatch) {
    // Follow the redirect
    try {
      const r2 = await fetchUrl(`https://tinyurl.com/${tinyMatch[1]}`);
      const final = r2.url;
      process.stderr.write(`  tinyurl → ${final}\n`);
      const m2 = final.match(/sudokupad\.app\/([A-Za-z0-9_\-+/=]+)/);
      if (m2) {
        const val = m2[1];
        if (val.startsWith('scl')) return { type: 'scl', value: val };
        return { type: 'token', value: val };
      }
    } catch (e) {
      process.stderr.write(`  tinyurl follow error: ${e.message}\n`);
    }
  }

  return null;
}

/**
 * Get the raw JS-object-literal puzzle data for a given token/scl value.
 */
async function getPuzzleJs(info) {
  if (info.type === 'scl') {
    // The SCL value IS the encoded puzzle — decode directly
    const decoded = decompressFromBase64(info.value.slice(3));
    return decoded || null;
  }

  // type === 'token': fetch from API
  try {
    const r = await fetchUrl(`https://sudokupad.app/api/puzzle/${info.value}`);
    return decodeApiResponse(r.body);
  } catch (e) {
    process.stderr.write(`  API fetch error: ${e.message}\n`);
    return null;
  }
}

// ── Entry construction ────────────────────────────────────────────────────────

function difficultyFromCount(n) {
  if (n >= 36) return 'easy';
  if (n >= 28) return 'medium';
  if (n >= 22) return 'hard';
  return 'very hard';
}

function makeId(ctcId, title) {
  const safe = title.toLowerCase().replace(/[^a-z0-9]+/g, '_').replace(/^_|_$/g, '').slice(0, 30);
  return `ctc_${ctcId}_${safe}`;
}

// ── Puzzle list ───────────────────────────────────────────────────────────────
const PUZZLES = [
  [2302, "The Loneliest Number", "Snyder"],
  [2250, "Crest of the Gorons", "Wei-Hwa Huang"],
  [2246, "Din's Pearl", "Wei-Hwa Huang"],
  [2247, "Crest of the Kokiri", "Wei-Hwa Huang"],
  [2248, "Forest Medallion", "Wei-Hwa Huang"],
  [485, "White Marlin", "Shye"],
  [436, "Arbitrary Code Execution", "Jovial"],
  [435, "Can't Teach An Old Dog", "Jovial"],
  [484, "Antidote", "Shye"],
  [483, "Smile", "Shye"],
  [467, "pipeline", "Mith"],
  [1581, "Long Distance Relationship", "RiSa"],
  [1279, "Fancy Vase", "Qinlux"],
  [481, "Kingda Ka", "Shye"],
  [480, "Binary Fission", "Shye"],
  [668, "Computer Solver Freaks Out", "Feadoor"],
  [1278, "noXing", "Qinlux"],
  [478, "Patto Patto", "Shye"],
  [206, "Cobra Roll", "Jovial"],
  [1301, "Steering Wheel", "SudokuExplorer"],
  [667, "The XY Ring", "Feadoor"],
  [421, "Hanabi", "Shye"],
  [419, "Valtari", "Shye"],
  [1626, "Give Me an X, Give Me a V", "aPete"],
  [683, "Learning to Solve Hard Sudoku", "Doulani"],
  [200, "Classic Sudoku", "Jovial"],
  [799, "Gridlocked", "Snyder"],
  [464, "22 Clues 7 Rows", "Mith"],
  [2447, "Skirmish in the Horsehead Nebula", "Øyvind"],
  [664, "The Expert's Sudoku Technique", "Feadoor"],
  [418, "Monte", "Shye"],
  [662, "Teaching the X-wing", "Feadoor"],
  [661, "Human Logic Trumps Computer", "Feadoor"],
  [459, "Tatooine Sunset", "Mith"],
  [660, "Stripe Sudoku", "Feadoor"],
  [995, "How do Grandmasters Solve so Fast", "Collyer"],
  [1326, "4x4 Magic Square", "Cam"],
  [559, "SVS(266) Tic Tac Toe", "Richard"],
  [658, "Unbelievable Masterpiece", "Feadoor"],
  [1324, "Goldilocks Sudoku", "Cam"],
  [657, "Small but Beautiful", "Feadoor"],
