];

// ── Main ──────────────────────────────────────────────────────────────────────
async function main() {
  const results = [];
  const skipped = [];

  for (const [ctcId, title, author] of PUZZLES) {
    process.stderr.write(`\n[${ctcId}] ${title} (${author})\n`);

    const info = await getSudokuPadInfo(ctcId);
    if (!info) {
      process.stderr.write(`  SKIP: no SudokuPad info found\n`);
