    process.stderr.write(`  type=${info.type} value=${info.value.slice(0, 20)}...\n`);
    await sleep(300);

    const jsObj = await getPuzzleJs(info);
    if (!jsObj) {
      process.stderr.write(`  SKIP: could not get puzzle data\n`);
      skipped.push([ctcId, title, 'no puzzle data']);
      await sleep(400);
      continue;
    }

    if (!isStandardRegions(jsObj)) {
      process.stderr.write(`  SKIP: non-standard regions\n`);
      skipped.push([ctcId, title, 'non-standard regions']);
      await sleep(200);
      continue;
    }

    if (hasExtraConstraints(jsObj)) {
      process.stderr.write(`  SKIP: extra constraints detected\n`);
      skipped.push([ctcId, title, 'extra constraints']);
      await sleep(200);
      continue;
    }

    const grid = parseCE(jsObj);
    if (!grid || grid.some(row => !row || row.length !== 9)) {
      process.stderr.write(`  SKIP: could not parse grid\n`);
      skipped.push([ctcId, title, 'parse error']);
      await sleep(200);
      continue;
    }

    const givens = grid.flat().join('');
    if (givens.length !== 81) {
      process.stderr.write(`  SKIP: givens length ${givens.length}\n`);
      skipped.push([ctcId, title, `givens length ${givens.length}`]);
      continue;
    }

    const nClues = givens.split('').filter(c => c !== '0').length;
    const diff = difficultyFromCount(nClues);
    process.stderr.write(`  OK: ${nClues} clues → ${diff}\n`);

    results.push({
      id: makeId(ctcId, title),
      name: title,
      difficulty: diff,
      author: author,
      reference: `https://crackingthecryptic.com/sudoku?id=${ctcId}`,
      description: `Classic sudoku by ${author}, featured on Cracking the Cryptic. ${nClues} given digits.`,
      givens: givens,
    });

    await sleep(300);
  }

  process.stderr.write(`\nImported: ${results.length}, Skipped: ${skipped.length}\n`);
  if (skipped.length > 0) {
    process.stderr.write('Skipped:\n');
    skipped.forEach(([id, name, reason]) => process.stderr.write(`  [${id}] ${name}: ${reason}\n`));
  }

  process.stdout.write(JSON.stringify(results, null, 2) + '\n');
}

main().catch(e => { process.stderr.write(`Fatal: ${e}\n`); process.exit(1); });

