    process.stderr.write(`  type=${info.type} value=${info.value.slice(0, 20)}...\n`);
    await sleep(300);

    const jsObj = await getPuzzleJs(info);
    if (!jsObj) {
      process.stderr.write(`  SKIP: could not get puzzle data\n`);
      skipped.push([ctcId, title, 'no puzzle data']);
      await sleep(400);
